import development from './DevelopmentSkillsArray';
import design from './DesignSkillsArray';

function SkillsMain() {
  return (
    <>
      <h2><em>Development</em></h2>
      <ul>
        {development.map((dev, index) => (
          <li key={index}>{dev}</li>
        ))}
      </ul>
      <h2><em>Design</em></h2>
      <ul>
        {design.map((des, index) => (
          <li key={index}>{des}</li>
        ))}
      </ul>
    </>
  );
}

export default SkillsMain;
